from collections import deque

class Solution:
    def maxAncestorDiff(self, root: Optional[TreeNode]) -> int:
        def bfs(root):
            if root is None:
                return None, None
            q = deque([(root, root.val, root.val)])
            while q:
                node, min_val, max_val = q.popleft()
                ans = max(abs(min_val - node.val), abs(max_val - node.val))
                if ans > self.ans:
                    self.ans = ans
                min_val = min(min_val, node.val)
                max_val = max(max_val, node.val)
                if node.left:
                    q.append((node.left, min_val, max_val))
                if node.right:
                    q.append((node.right, min_val, max_val))
            return None, None
        self.ans = 0
        bfs(root)
        return self.ans
